measurements.description:
Nineteen full well-proportioned flowers and four buds on two inflorescences, longest 70cm;
	sepals and petals pale green, fine maroon speckling, denser distally;
	unusual cream-colored lip, overlaid broad rose band distally, darkening to maroon band apically;
	column rose, ventral surface spotted burgundy, anther cap yellow;

	substance firm; texture matte.
